import { AppBar, Toolbar, Typography } from "@mui/material";
import React from "react";
import Icons from "../Icons/icons";
import "./NavBar.scss";
function NavBar() {
  return (
    <AppBar
      position="static"
      classes={{
        root: "navigation-bar",
      }}
    >
      <Toolbar variant="dense" classes={{ root: "tool-bar" }}>
        <Icons.Lophyllo_logogo />
      </Toolbar>
    </AppBar>
  );
}

export default NavBar;
